import React, { useState } from 'react';
import './AdopterRegiForm.css';
import { useNavigate } from 'react-router-dom';

function AdopterRegiForm() {
  const [values, setValues] = useState({
    adoName: '',
    adoEmail: '',
    adoPhone: '',
    adoLocation: '',
    adoNIC:'',
    adoAge:'',
    adoJob:'',
    adoGender:'',
    userID: ''
  });

  const [errors, setErrors] = useState({});
  const navigate = useNavigate();

  const handleSubmit = async (event) => {
    event.preventDefault();
    const validationErrors = validateInputs(values);
    setErrors(validationErrors);

    if (Object.keys(validationErrors).length === 0) {
      try {
        const response = await fetch('http://localhost:8800/api/adopter/register', {
          method: 'POST',
          headers: {
            'Content-Type': 'application/json'
          },
          body: JSON.stringify(values)
        });

        const result = await response.json();

        if (response.ok) {
          alert(result.message || 'Adopter registered successfully');
        //   window.location.href = '/pet/register';
        } else {
          alert(result.error || 'This user ID is wrong or already assigned. Please sign up.');
          navigate('/signup');
        }
      } catch (error) {
        console.error('Error:', error);
      }
    }
  };

  const handleInput = (event) => {
    const { name, value } = event.target;
    setValues((prev) => ({ ...prev, [name]: value }));
  };

  const validateInputs = (values) => {
    let errors = {};
    if (!values.adoName) errors.adoName = 'Adopter Name is required';
    if (!values.adoEmail) errors.adoEmail = 'Adopter Email is required';
    if (!values.adoPhone) errors.adoPhone = 'Adopter Phone is required';
    if (!values.adoLocation) errors.adoLocation = 'Adopter Location is required';
    if (!values.adoNIC) errors.adoNIC = 'Adopter NIC is required';
    if (!values.adoAge) errors.adoAge = 'Adopter Age is required';
    if (!values.adoGender) errors.adoGender = 'Adopter Gender is required';
    if (!values.adoJob) errors.adoJob= 'Adopter Job is required';
    if (!values.userID) errors.userID = 'User ID is required';
    return errors;
  };

  const backgroundStyle = {
    backgroundImage: "url('/images/login1.jpg')",
    backgroundSize: 'cover',
    backgroundPosition: 'center',
    minHeight: '100vh',
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center'
  };

  return (
    <div className="ado-form-container" style={backgroundStyle}>
       <h1 className="ado-welcome-message">Join Our Network</h1>
  <div className="ado-registration-card">

    <div className="ado-registration-card-body">
      <h2 className="ado-regi-form-name">Adopter Registration</h2>
      <form onSubmit={handleSubmit}>
        <div className="ado-form-group">
          <label htmlFor="adoName">Adopter Name</label>
          <input
            type="text"
            name="adoName"
            value={values.adoName}
            onChange={handleInput}
            required
            placeholder="Enter Adopter Name"
          />
          {errors.adoName && <span className="text-danger">{errors.adoName}</span>}
        </div>

        <div className="ado-form-group">
          <label htmlFor="adoEmail">Adopter Email</label>
          <input
            type="email"
            name="adoEmail"
            value={values.adoEmail}
            onChange={handleInput}
            required
            placeholder="Enter Distributor Email"
          />
          {errors.adoEmail && <span className="text-danger">{errors.adoEmail}</span>}
        </div>

        <div className="ado-form-group">
          <label htmlFor="adoPhone">Adopter Phone</label>
          <input
            type="text"
            name="adoPhone"
            value={values.adoPhone}
            onChange={handleInput}
            required
            placeholder="Enter Phone"
          />
          {errors.adoPhone && <span className="text-danger">{errors.adoPhone}</span>}
        </div>

        <div className="ado-form-group">
          <label htmlFor="adoGender">Adopter Gender</label>
          <input
            type="text"
            name="adoGender"
            value={values.adoGender}
            onChange={handleInput}
            required
            placeholder="Enter Gender"
          />
          {errors.adoGender && <span className="text-danger">{errors.adoGender}</span>}
        </div>

        <div className="ado-form-group">
          <label htmlFor="adoNIC">Adopter NICe</label>
          <input
            type="text"
